import * as React from "react";
import { NavItemProps } from "../types";

export const NavItem: React.FC<NavItemProps> = ({ label, isHighlighted }) => {
  const baseStyles = "self-stretch my-auto";
  const highlightedStyles = isHighlighted ? "px-3.5 text-red-400 bg-white rounded-3xl w-[138px]" : "";

  return (
    <button
      className={`${baseStyles} ${highlightedStyles}`}
      role="menuitem"
      tabIndex={0}
    >
      {label}
    </button>
  );
};
